import React from 'react';
import Project from './Project';
import './Projects.css';

const projectData = [
  {
    title: "Figg's Window Cleaning Website",
    description: 'Created a website for a local window cleaning company.',
    githubLink: 'https://github.com/RyanSmith19/figg-window-cleaning',
    projectLink: 'https://figgwindowcleaning.rf.gd'
  },
  {
    title: 'Daily Quote Email',
    description: 'Pulls the "Quote of the Day" from a quote website and sends it to my email.',
    githubLink: 'https://github.com/RyanSmith19/DailyGraceQuote',
  },
  {
    title: 'Carpool Organizing Script',
    description: 'Automates the organization of carpools using Google Sheets. Matches drivers and riders based on availability, location, and preferences. Outputs results into organized sheets for easy management. Key Features: Matches drivers with riders, Handles unmatched riders, Updates in real-time via Google Form submissions.',
    githubLink: 'https://github.com/RyanSmith19/BereanCarpoolRidesOrganizer',
    projectLink: 'https://carpoolorganizer.com' // Example link
  },

  // Add more projects as needed
];

const Projects = () => {
  return (
    <section id="projects" className="projects">
      <h2>Projects</h2>
      <div className="project-grid">
        {projectData.map((project, index) => (
          <Project
            key={index}
            title={project.title}
            description={project.description}
            projectLink={project.projectLink}
            githubLink={project.githubLink}
          />
        ))}
      </div>
    </section>
  );
};

export default Projects;
